import React from 'react';
import { Grid, Paper, Avatar, TextField, FormControlLabel, Button, Typography, Link } from "@material-ui/core";
import DashboardOutlinedIcon from '@material-ui/icons/DashboardOutlined';
import Checkbox from '@material-ui/core/Checkbox';


const Login = () => {

    const paperStyle = { padding: 20, height: "50vh", width: 340, margin: "80px auto" }
    const avatarStyle = { backgroundColor: "#1c4c74" }
    const btnStyle = { margin: '8px 0' }
    return (
        <Grid>
            <Paper elevation={10} style={paperStyle}>
                <Grid align="center">
                    <Avatar style={avatarStyle}><DashboardOutlinedIcon /></Avatar>
                    <h2>Sign In</h2>
                </Grid>
                <TextField label='Username' placeholder='Enter your username..' fullWidth required/>
                <TextField label='Password' placeholder='Enter your password..' type='password' fullWidth required />
                <FormControlLabel
                    control={
                        <Checkbox

                            name="checkedB"
                            color="primary"
                        />
                    }
                    label="Remember Me"
                />
                <Button type='submit' color='primary' style={btnStyle} fullWidth variant='contained'>Sign In</Button>
                <Typography>
                    <Link href='#' >
                        Forgot Password ?
                    </Link>
                </Typography>
                <Typography> Do you have an account ?
                    <Link href='#' >
                        Sign Up
                    </Link>
                </Typography>
            </Paper>
        </Grid>
    )
}
export default Login;
